        //         <li><a href={"https://github.com/" + section}>{section}</a></li>

        //     )

        // })
        return (
            <nav>
               <h2 className="Logo">{this.props.LogoTitle}</h2>

               <ul>
                    <li><a href={"#"}>Home</a></li>
                    <li><a href={"#"}>Resume</a></li>
                    <li><a href={"#"}>Contact</a></li>

               </ul>
            </nav>

        );

    }


}


export default Navigation;
